import {Route} from 'react-router-dom'
import Product from "./Pages/Product";
import Welcome from "./Pages/Welcome";
import MainHeader from "./Components/MainHeader";
function App() {
  return (
    <div>
        <MainHeader />
        <main>
            <Route path="/product">
                <Product />
            </Route>
            <Route path="/welcome">
                <Welcome />
            </Route>
        </main>

    </div>
  );
}

export default App;
